import './App.css';
import styled from 'styled-components';

const
 StyledBook = styled.div
`
  width: 100%;
  max-width: 900px;
  background-color: #009688;
  border-radius: 10px;
  padding: 20px;
  display: flex;
  gap: 20px
`

const
 StyledAddress = styled.div
`
  width: 100px;
  height: 100px;
  border-radius: 5px;
  background-color: #fefefe;
  &:last-of-type {
    flex-grow:1;
  }
`;

function Attention() { 
return(
    <StyledBook>
      <StyledAddress/>
      <StyledAddress/>
      <StyledAddress/>
    </StyledBook>
  )
}


function App() {
    return (
        <div className="App">
            <Attention />
        </div>
    );
}

export default App;
